  { id: 1, lastName: 'Mendez', firstName: 'Sara', email: 'sara987@gmail.com'  , dni : 'DNI 20980272' , matricula : '981626' , estado : 'Activo'},
  { id: 2, lastName: 'Mariana', firstName: 'Lopez',email: 'loperbs@gmail.com' , dni : 'DNI 28980656'  , matricula : '129800' , estado : 'Activo' },
  { id: 3, lastName: 'Fernando', firstName: 'Jaime', email:'jaimeodon@gmail.com'  ,  dni : 'DNI 32772090'  ,matricula : '323226'  , estado : 'Activo'} 
];

const MedicosTabla = () => {

  return (
